export const getdataAction = (data) => {

  return (dispatch,getState)=>{
    getdata(dispatch)
  }
 
};

async function getdata(dispatch) {

  try {
    const response = await axios.get(data);
    dispatch(response.data)

  } catch (error) {
    console.error(error);
  }
} 
